import React from 'react';
import * as ReactDOM from 'react-dom';

const App = () => {
    return (
        <div>
            <h2>This is the app!</h2>
            <p>More text</p>
        </div>
    )
}

ReactDOM.render(<App />, document.querySelector("root"));
